import './App.css';
import React from 'react';
import {display} from './Reducers/YoutReducer'
 import {useSelector ,useDispatch} from 'react-redux'

import axios from 'axios'

 function App() {


  const state =useSelector((state) => {

    return {
      disYout:state.YoutReducer.yout,
      count :state.YoutReducer.count
    }
  })

  const dispatch=useDispatch()

  React.useEffect(()=>{
    axios.get('https://jsonplaceholder.typicode.com/todos/')
    .then((res)=>{
      console.log(res.data)
      dispatch(display(res.data))
    })

  },[])

  return (
     <>

<header> 
<h1 className='subject'>Youtube website</h1>


<form className='searchForm'>  


<input className='searchInput' type='search' placeholder ='Search'></input>
<input className='searchBtn' type='submit'></input>
</form>
 </header>
<hr/>

<div className='BigBox'> 

{state.disYout.map((you)=> {
  return(

    <div className='Small'> 
  <p>Task{you.id}</p> 
  <p>{you.title}</p>
  </div>

  )
})}
</div>
     </>
  );
}

export default App;
